import React from "react";
import { NavItem, Navbar } from "react-bootstrap";

const Nav = () => {

  return (

    <Navbar inverse collapseOnSelect>
      <Navbar.Header>
        <Navbar.Brand>
          <a href="#brand">React-Bootstrap</a>
        </Navbar.Brand>
        <Navbar.Toggle />
      </Navbar.Header>
      <Navbar.Collapse>
        <Nav>
          <NavItem eventKey={1} href="#">
            Link
          </NavItem>
          <NavItem eventKey={2} href="#">
            Link
          </NavItem>

        </Nav>

      </Navbar.Collapse>
    </Navbar>

  )

};

export default Nav;
